import React from 'react';

export const Terminal = ({ listOfThreads }) => {
    return (
        <>
            {listOfThreads.map(thread => {
                return(
                    <ul>
                        <li>{thread.thread_id}</li>
                        <li>{thread.thread_name}</li>
                        <li>{thread.thread_description}</li>
                        <li>{thread.thread_date}</li>
                    </ul>
                )
            })}
        </>
    )
}
